import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';
import Header from './Header';

function App() {
  return (
    <div className="App">
        
          <Router>
          <Routes>
          <Route path="/" element={<><Header /></>} />
          </Routes>
          </Router>
    </div>
  );
}

export default App;
